import React from 'react'

import bottle from '../assets/choppedBottle.png';


export default class MobileBottle extends React.Component {
    render() {
        return (
            <div id="footer-bottle-wrap">
                <div id="bottlemob-wrap">
                    <img src={bottle} alt="green tea bottle" id="bottlemob" />
                </div>
                <div id="bottle-text-mobile">
                    <ul>
                        <li> <p id="arrow-text"> Natural source of caffine boosted with other minerals to improve brain functions </p></li>
                        <li> <p id="arrow-text"> Healthier than coffee and speeds up metabolism </p> </li>
                        <li> <p id="arrow-text"> Loaded with antioxidannts </p></li>




                    </ul>
                </div>
            </div>
        );
    }
};
